    // storage permission on adnroid device
    getstoragepermission() {
        this.androidPermissions.checkPermission(this.androidPermissions.PERMISSION.READ_EXTERNAL_STORAGE).then(result => {
            if (result.hasPermission) {
                console.log('Has permission?', result.hasPermission);
                this.haspermission = result.hasPermission;
            }
            else {
                console.log('Has permission?', result.hasPermission);
                this.haspermission = result.hasPermission;
                this.androidPermissions.requestPermission(this.androidPermissions.PERMISSION.READ_EXTERNAL_STORAGE).then(res => {
                    if (res.hasPermission) {
                        console.log('Has permission?', res.hasPermission);
                        this.haspermission = res.hasPermission;
                    }
                    else {
                        this.androidPermissions.requestPermission(this.androidPermissions.PERMISSION.READ_EXTERNAL_STORAGE);
                        this.permissonArray.push('No Permission');
                        if (this.permissonArray.length == 1) {
                            this.permissonArray = [];
                            //alert("To allow permission, Please set 'Reset app preferences' manually to your device settting");
                            this.translate.use(this.selectedLanguage);
                            this.translate.get('Jawata needs permission to your Phone storage. To allow permission go to the  app permissions in your device setting').subscribe((res) => {
                                alert(res);
                            });
                        }
                    }
                });
            }
        }, err => this.androidPermissions.requestPermission(this.androidPermissions.PERMISSION.READ_EXTERNAL_STORAGE));
    }
